import { Injectable } from '@angular/core';
import { autoTable, RowInput } from 'jspdf-autotable';
import jsPDF from 'jspdf';
import { Turno } from '../classes/turnos';

const imagen=''
@Injectable({
  providedIn: 'root'
})
export class ExportarPdfService {
  constructor() { }

  exportarPdf(turnos:Turno[]){
    const doc= new jsPDF();
    var width=10;
    var height=10;
    let auxData:any[]=[];
    doc.addImage(imagen,'png',180,30,width,height);
    doc.text("Clinica Historial Clinico", 20, 20);
    let columns = ['Especialidad',
    'Diagnostico',
    'Medico',
    'Fecha',
    'Hora',];
    turnos.forEach((d:Turno) => {
      const diaputo=d.Terminado?.toString();
      const evento=new Date(diaputo);

      let objAux:any = {
        Especialidad: d.especialidad,
        Diagnostico: d.diagnostico,
        ApellidoMedico: d.especialista?.apellido + ", " + d.especialista?.nombre,
        fechaAtencion: evento.toLocaleDateString(),
        horaAtencion: evento.toLocaleTimeString()

      }
      auxData.push(objAux);
    });
    doc.table( 10, 70, auxData, Object.keys( auxData[0] ), { autoSize: false, margins: 10 } );
    doc.save('Historial_Clinico.pdf')
  }


}
